import React from 'react'
import IconArrowRight from '../../assets/images/IconArrowRight'

export const Pagination = ({offset, onClickBack, onClickNext, page}) => {
  return (
    <div>
        {offset === 20 ? null :<button onClick={onClickBack}><IconArrowRight /></button>}

        <p>{page}</p>

        {offset === 140 ? null :<button onClick={onClickNext}>Next</button> }
    </div>
  )
}
